style.css:
@-moz-document domain(reddit.com) {
	.arrow.up {
	  visibility: hidden;
	}

	.arrow.upmod {
	  visibility: hidden;
	}

	.arrow.down {
	  visibility: hidden;
	}

	.arrow.downmod {
	  visibility: hidden;
	}

	.likes .score.likes {
	  display: none;
	}

	.score.unvoted {
	  display: none;
	}
}
